:- module(dijkstra,[edge/3,dijkstra/1,teste/0,test/1]).
:- use_module(library(chr)).

option(debug,off).
option(optimize,full).
option(check_guard_bindings,off).

:- use_module(fib_heap).

constraints edge/3, distance/2, dijkstra/1, scan/2, relabel/2.

option(mode,edge(+,+,+)).
option(mode,distance(+,+)).
option(mode,dijkstra(+)).
option(mode,scan(+,+)).
option(mode,relabel(+,+)).
option(type_declaration,edge(int,int,number)).
option(type_declaration,distance(int,number)).
option(type_declaration,dijkstra(int)).
option(type_declaration,scan(int,number)).
option(type_declaration,relabel(int,number)).

start_scanning @ dijkstra(A) <=> scan(A,0).
label_neighb @ scan(N,L), edge(N,N2,W) ==> L2 is L+W, relabel(N2,L2).
scan_next    @ scan(N,L) <=> distance(N,L), 
                            (extract_min(N2,L2) -> scan(N2,L2) ; true).
scanned     @ distance(N,_) \ relabel(N,_) <=> true.
not_scanned @ relabel(N,L) <=> decr_or_ins(N,L).

test(_) :- test1, test2, test3, test4, dijkstra(1).

